function bhtKBAddInput(attributes) {

    var code = "<input ";

    var attrs = "";

    var keys = Object.keys(attributes);

    for (var i = 0; i < keys.length; i++) {

        attrs += keys[i] + "='" + attributes[keys[i]] + "' ";

    }

    code += attrs + " />";

    return code;

}

