function bhtKBSwitchKeyboard() {

    if (!__$("bhtKBKeyboardTable"))
        return;

    var keyboard = __$("bhtKBKeyboardTable");

    keyboard.innerHTML = "";

    var keys = [
        ["Q", "W", "E", "R", "T", "Y", "U", "I", "O", "P"],
        ["A", "S", "D", "F", "G", "H", "J", "K", "L", "del"],
        ["Z", "X", "C", "V", "B", "N", "M", "abc"]
    ];

    if (bhtKeyboardType == bhtKeyboardTypeABC) {

        keys = [
            ["A", "B", "C", "D", "E", "F", "G", "H", "I", "J"],
            ["K", "L", "M", "N", "O", "P", "Q", "R", "S", "del"],
            ["T", "U", "V", "W", "X", "Y", "Z", "qwerty"]
        ];

    }

    for (var i = 0; i < keys.length; i++) {

        var row = document.createElement("div");
        row.style.display = "table-row";

        keyboard.appendChild(row);

        var cell = document.createElement("div");
        cell.style.display = "table-cell";
        cell.style.textAlign = "center";

        row.appendChild(cell);

        for (var j = 0; j < keys[i].length; j++) {

            var btn = document.createElement("button");
            btn.innerHTML = keys[i][j].trim();
            btn.style.display = "inline-block";
            btn.className = "blue";
            btn.style.fontSize = "18px";
            btn.style.minWidth = "30px";
            btn.style.minHeight = "30px";
            btn.style.width = (keys[i][j].toLowerCase().trim() == bhtKeyboardTypeQWERTY ||
                keys[i][j].toLowerCase().trim() == bhtKeyboardTypeABC ? "100px" : "50px");
            btn.style.height = "50px";
            btn.style.padding = "5px";
            btn.style.marginRight = "4px";
            btn.style.marginLeft = "4px";
            /*btn.style.backgroundColor = "#3c60b1";
             btn.style.color = "#fff";
             btn.style.border = "2px outset #3c60b1";*/

            btn.onmousedown = function () {

                if (this.innerHTML.trim().toLowerCase() == bhtKeyboardTypeQWERTY || this.innerHTML.trim().toLowerCase() == bhtKeyboardTypeABC) {

                    if (this.innerHTML.trim().toLowerCase() == bhtKeyboardTypeQWERTY) {

                        bhtKeyboardType = bhtKeyboardTypeQWERTY;

                        this.innerHTML = bhtKeyboardTypeABC;

                    } else {

                        bhtKeyboardType = bhtKeyboardTypeABC;

                        this.innerHTML = bhtKeyboardTypeQWERTY;

                    }

                    bhtKBSwitchKeyboard();

                } else if (this.innerHTML.trim().toLowerCase() == "del") {

                    if (__$("bhtKBSymptoms")) {

                        var str = __$("bhtKBSymptoms").value.trim();

                        if (str.length > 0) {

                            str = str.substring(0, str.length - 1);

                        }

                        __$("bhtKBSymptoms").value = str;

                    }

                } else {

                    if (__$("bhtKBSymptoms")) {

                        __$("bhtKBSymptoms").value += this.innerHTML.trim().toLowerCase();

                    }

                }

            }

            cell.appendChild(btn);

        }

    }

}

