function bhtKBAjaxRequest(url, callback) {

    var httpRequest = new XMLHttpRequest();

    httpRequest.onreadystatechange = function () {
        bhtKBHandleAjaxRequest(httpRequest, callback);
    };
    try {
        httpRequest.open("GET", url, true);
        httpRequest.setRequestHeader("Content-type", "application/json;charset=UTF-8");
        httpRequest.send(null);
    } catch (e) {
    }
}

function bhtKBHandleAjaxRequest(aXMLHttpRequest, callback) {
    if (!aXMLHttpRequest) return;

    if (aXMLHttpRequest.readyState == 4 && (aXMLHttpRequest.status == 200 ||
        aXMLHttpRequest.status == 304)) {

        var result = JSON.parse(aXMLHttpRequest.responseText);

        callback(result);

    }
}

